  out5_expected_1 <= '0';

  out5_ref <= out5_expected_1;

  out5_checker: PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      out5_testFailure <= '0';
    ELSIF clk'event AND clk = '1' THEN
      IF ce_out = '1' AND out5 /= out5_ref THEN
        out5_testFailure <= '1';
        ASSERT FALSE
          REPORT "Error in out5: Expected " & to_hex(out5_ref) & (" Actual " & to_hex(out5))
          SEVERITY ERROR;
      END IF;
    END IF;
  END PROCESS out5_checker;

  -- Data source for out6_expected
  out6_expected_1 <= '0';

  out6_ref <= out6_expected_1;

  out6_checker: PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      out6_testFailure <= '0';
    ELSIF clk'event AND clk = '1' THEN
      IF ce_out = '1' AND out6 /= out6_ref THEN
        out6_testFailure <= '1';
        ASSERT FALSE
          REPORT "Error in out6: Expected " & to_hex(out6_ref) & (" Actual " & to_hex(out6))
          SEVERITY ERROR;
      END IF;
    END IF;
  END PROCESS out6_checker;

  -- Data source for out7_expected
  out7_expected_1 <= '1';

  out7_ref <= out7_expected_1;

  out7_checker: PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      out7_testFailure <= '0';
    ELSIF clk'event AND clk = '1' THEN
      IF ce_out = '1' AND out7 /= out7_ref THEN
        out7_testFailure <= '1';
        ASSERT FALSE
          REPORT "Error in out7: Expected " & to_hex(out7_ref) & (" Actual " & to_hex(out7))
          SEVERITY ERROR;
      END IF;
    END IF;
  END PROCESS out7_checker;

  testFailure <= out7_testFailure OR (out6_testFailure OR (out5_testFailure OR (out4_testFailure OR (out3_testFailure OR (out2_testFailure OR (out_rsvd_testFailure OR out1_testFailure))))));

  completed_msg: PROCESS (clk)
  BEGIN
    IF clk'event AND clk = '1' THEN
      IF snkDone = '1' THEN
        IF testFailure = '0' THEN
          ASSERT FALSE
            REPORT "**************TEST COMPLETED (PASSED)**************"
            SEVERITY NOTE;
        ELSE
          ASSERT FALSE
            REPORT "**************TEST COMPLETED (FAILED)**************"
            SEVERITY NOTE;
        END IF;
      END IF;
    END IF;
  END PROCESS completed_msg;

END rtl;

